AD_TABLE.HQLQUERY:
SELECT
  e.id,
  @movementQuantity@ as movementQuantity,
  (select uom.name from UOM uom where uom.id = e.uOM.id) as uOM,
  (select p.name from Product p where p.id = e.product.id) as product,
  e.lineNo,
  e.creationDate as created,
  e.createdBy.name as createdBy,
  e.updated as updated,
  e.updatedBy.name as updatedBy,
  @operativeUOM@ as operativeUOM,
  @operativeQuantity@ as operativeQuantity,
  @orderQuantity@ as orderQuantity,
  sh.movementDate as movementDate,
  (select wh.name from Warehouse wh where wh.id = sh.warehouse.id) as warehouse,
  sh.documentNo as documentNo,
  (select sb.searchKey from Locator sb where sb.id = e.storageBin.id) as storageBin
  @selectClause@
MAINFROM
  @fromClause@
WHERE
  @additional_filters@
  @whereClause@
GROUP BY
  @groupByClause@

SELECT
  e.id,
  @orderedQuantity@ as orderedQuantity,
  (select uom.name from UOM uom where uom.id = e.uOM.id) as uOM,
  (select p.name from Product p where p.id = e.product.id) as product,
  e.lineNo,
  @operativeQuantity@ as operativeQuantity,
  @operativeUOM@ as operativeUOM,
  @orderQuantity@ as orderQuantity,
  il.id,
  e.orderDate as orderDate,
  e.creationDate as created,
  e.createdBy.name as createdBy,
  e.updated as updated,
  e.updatedBy.name as updatedBy,
  @scheduledDeliveryDate@ as scheduledDeliveryDate, 
  @warehouse@ as warehouse,  
  @documentNo@ as documentNo,
  @grandTotalAmount@ as grandTotalAmount
  @selectClause@
MAINFROM
  @fromClause@
WHERE
  @additional_filters@
  @whereClause@
GROUP BY
  @groupByClause@
